import './App.css';

function App() {

  const atividades = [
    {
      "id": 1,
      "descricao": "Primeira Atividade"
    }

  ]

  return (
    <div className="mt-3">
      <ul className="list-group">
        <li className="list-group-item">
          {atividades[0].id} {atividades[0].descricao}
        </li>
      </ul>
    </div>
  );
}

export default App;
